import React from "react";
import './Nav.css';
import { useDispatch } from 'react-redux';
import { orderByRaza } from '../Redux/Actions/Action'

function Nav(){
    const dispatch = useDispatch()

    // FILTROS ->
    function handleSort(e){
        e.preventDefault();
        dispatch(orderByRaza(e.target.value))
        console.log('se mando el handleSort');
        // setCurrentPage(1);

    }



    return (
        <ul className="ulMenu">
            <li><select onClick={e => handleSort(e)}> 
                <option value='asc'> Ascendente </option>
                <option value='desc'> Descendente </option> 
            </select></li>
            <li><select> 
                <option value={2}> optionSelect </option> 
            </select></li>
            <li><select> 
                <option value={3}> optionSelect </option> 
            </select></li>
        </ul>
    )
}
export default Nav;
